            <div style={{width:"65%" }}><img style={{width:"100%", height:"100%",position:'absolute'}} src="/Images/image.jpg" />
            <div style={{border:"2px solid blue",height:"50%",width:"40%",position :"absolute"}}></div></div>
            {/* <div style={{width:"30%",margin:"-10%",border:"2px solid blue"}} ></div> */}
        </div>
    );
};


export default MainBody ;
